import React, { useEffect, useState } from "react";
import axios from "axios";
import Card from "../components/Card";
import Button from "../components/Button";
import {
  Users,
  Package,
  ShoppingCart,
  DollarSign,
  RefreshCcw,
  ExternalLink,
} from "lucide-react";

export default function Dashboard() {
  const [customerCount, setCustomerCount] = useState(0);
  const [productCount, setProductCount] = useState(0);
  const [orderCount, setOrderCount] = useState(0);
  const [revenue, setRevenue] = useState(0);
  const [lastUpdated, setLastUpdated] = useState("");

  const fetchAllData = async () => {
    try {
      const [customers, products, orders] = await Promise.all([
        axios.get("http://localhost:5000/api/customers"),
        axios.get("http://localhost:5000/api/products"),
        axios.get("http://localhost:5000/api/orders"),
      ]);

      setCustomerCount(customers.data.length);
      setProductCount(products.data.length);
      setOrderCount(orders.data.length);

      const totalRevenue = orders.data.reduce((sum, order) => sum + order.total_price, 0);
      setRevenue(totalRevenue.toFixed(2));

      const now = new Date();
      setLastUpdated(now.toLocaleTimeString());
    } catch (err) {
      console.error("Error fetching dashboard data:", err);
    }
  };

  const handleIngest = async (type) => {
    try {
      const res = await axios.get(`http://localhost:5000/api/ingest/${type}`);
      alert(`✅ ${type} ingested: ${res.data.count}`);
      fetchAllData(); // Refresh dashboard stats
    } catch (err) {
      alert(`❌ Failed to ingest ${type}`);
      console.error(`Error ingesting ${type}:`, err);
    }
  };

  useEffect(() => {
    fetchAllData();
  }, []);

  return (
    <div className="p-6 space-y-8">
      {/* Header */}
      <div className="flex justify-between items-center">
        <h1 className="text-xl font-bold">Shopify Analytics</h1>
        <div className="flex items-center gap-3">
          <span className="text-sm text-gray-500">Last updated: {lastUpdated}</span>
          <Button
            className="bg-gray-100 hover:bg-gray-200 flex items-center gap-2"
            onClick={fetchAllData}
          >
            <RefreshCcw size={16} /> Refresh
          </Button>
          <Button className="bg-green-500 hover:bg-green-600 text-white flex items-center gap-2">
            <ExternalLink size={16} /> Shopify Admin
          </Button>
        </div>
      </div>

      {/* Overview Section */}
      <h2 className="text-lg font-semibold">Overview</h2>
      <div className="grid grid-cols-1 md:grid-cols-4 gap-4">
        <Card className="bg-green-100">
          <div>
            <p className="text-gray-600">Total Customers</p>
            <p className="text-2xl font-bold">{customerCount}</p>
          </div>
        </Card>
        <Card className="bg-cyan-100">
          <div>
            <p className="text-gray-600">Products</p>
            <p className="text-2xl font-bold">{productCount}</p>
          </div>
        </Card>
        <Card className="bg-green-200">
          <div>
            <p className="text-gray-600">Orders</p>
            <p className="text-2xl font-bold">{orderCount}</p>
          </div>
        </Card>
        <Card className="bg-orange-200">
          <div>
            <p className="text-gray-600">Revenue</p>
            <p className="text-2xl font-bold">₹{revenue}</p>
          </div>
        </Card>
      </div>

      {/* Data Ingestion */}
      <h2 className="text-lg font-semibold">Data Ingestion</h2>
      <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
        <Button
          className="bg-gray-100 hover:bg-gray-200 flex justify-center items-center gap-2"
          onClick={() => handleIngest("customers")}
        >
          <Users size={20} /> Ingest Customers
        </Button>
        <Button
          className="bg-gray-100 hover:bg-gray-200 flex justify-center items-center gap-2"
          onClick={() => handleIngest("products")}
        >
          <Package size={20} /> Ingest Products
        </Button>
        <Button
          className="bg-gray-100 hover:bg-gray-200 flex justify-center items-center gap-2"
          onClick={() => handleIngest("orders")}
        >
          <ShoppingCart size={20} /> Ingest Orders
        </Button>
      </div>
    </div>
  );
}
